ith all the amenities of a modern indoor ballroom. Large windows brighten the finely appointed space, offering a panorama of lush woods and greenery that creates a truly stunning setting. From wedding receptions and social functions to trade shows and conferences, The Oak Room, will transform your gathering and create unforgettable memories."},testimonials:{thanks:"Thank you,",testOne:"We appreciate the work you and your staff did coordinating our workshop today. The room was great and just what we asked for. We received several comments about how nice the Venue was as well as the staff. Our officials said it was one of the nicest facilities they had used for their workshops. We look forward to working with Ogeechee Tech again in the future.",testTwo:"I would like to take the time out to thank the Venues at Ogeechee Technical College for allowing us to hold our wedding there on July 6, 2019. Our wedding was a fairytale come true. We enjoyed everything about the venue and received so many compliments. I am so thankful we chose The Venues at Ogeechee Tech. Thanks again to the whole team at Ogeechee Technical College. Look forward to working with you in the future.",testThree:'We would highly recommend the "Oak Room" facility and the staff to anyone looking for an exceptional venue for an event. We had a rehearsal dinner for close to 100 people and everything discussed and planned for us was perfect.  The facility is beautiful, clean and the staff was present before, during and after our event. Thank you to Ogeechee Tech for sharing such a beautiful facility and the wonderful staff, to help us enjoy such a memorable time for our son and new daughter-n-law. ',testFour:"We highly recommend Ogeechee Tech for all your business event needs. The staff is always so helpful and accommodating. The Board Room is so great for business meetings and The Oak Room is absolutely amazing! We have hosted many events over the years with Ogeechee Tech and have never been disappointed! We 