os!",oakText:"El Oak Room",oakSub:"Grandes ventanales iluminan este espacio finamente decorado.",riverText:"El River Room",riverSub:"El River Room es cómodo y funcional para seminarios de capacitación, conferencias y presentaciones.",magnoliaText:"El Magnolia Boardroom",magnoliaSub:"Conocida como la sala de juntas más elegante en esta área.",kennedybText:"El Kennedy Boardroom",kennedybSub:"El Kennedy Boardroom ofrece el mejor escenario para su próxima reunión de negocios.",ogeecheeText:"El Ogeechee Boardroom",ogeecheeSub:"El Ogeechee Boardroom tiene capacidad para 16 personas alrededor de una mesa de conferencias de estilo ejecutivo.",kennedyaText:"El Kennedy Auditorium",kennedyaSub:"Desde sesiones de capacitación hasta oradores de renombre este auditorio recientemente renovado ofrece una experiencia brillante en el lugar.",computerText:"Laboratorios de Computación",computerSub:"Nuestros laboratorios de computadoras pueden acomodar hasta 25 personas.",classroomText:"Aulas",classroomSub:"Ofrecemos una amplia gama de aulas con capacidad para 15 a 40 participantes.",atriumText:"El Atrium",atriumSub:"¡El Atrium es simplemente hermoso!"},home:{title:"Bienvenido al Venues!",pOne:"Cuando se trata de celebraciones de bodas memorables, fiestas festivas emocionantes, grandes reuniones regionales o un retiro ejecutivo, las personas a menudo recurren a Los Venues. Desde laboratorios de computación hasta auditorios, salas de conferencias y salas de juntas, tenemos espacios únicos para todo tipo de eventos.",pTwo:"La joya de la corona de Los Venues es un hermoso salón de baile con ventanas del piso al techo con vista a acres de abedul acuático y altos pinos de Georgia, con columnas de piedra y servicio audiovisual de última generación. Las amenidades que ofrece el salón de baile incluyen un amplio atrio delantero y terraza, una cocina preparatoria de servicio completo, acceso a Wi-Fi, dos proyectores LCD, una computadora, podio, micrófono inalámbrico y sistema de sonido. Los hermosos espacios al aire libre y los espacios interiores cálidos y acogedores se combinan para formar uno de los escenarios más llamativos de esta región.",pThree:"Convenientemente ubicado a solo minutos de la I-16 y el centro de Statesboro, nuestros espacios son el lugar ideal para negocios y reuniones sociales de todo tipo. Elegido como uno de los mejores lugares para celebrar un evento, The Venues es fácilmente accesible, tiene un amplio estacionamiento gratuito y tiene múltiples opciones a precios asequibles.",cardBusiness:"Eventos Empresariales",textBusiness:"Conocida como la sala de juntas más elegante en esta área, este espacio profesional fue diseñado específicamente para reuniones ejecutivas de hasta 20 participantes. Ubicada justo al lado del vestíbulo principal en el Edificio de Recursos Naturales, la sala de juntas Magnolia ofrece un entorno impresionante para su próxima reunión corporativa. Las grandes ventanas con persianas se extienden a lo largo del salón permitiendo privacidad, mientras la luz natural continúa filtrándose através de ellas.",cardWeddings:"Bodas y Eventos Sociales",textWeddings:"Ofrezca a sus invitados el ambiente de un evento al aire libre con todas las comodidades de un salón interior moderno. Las grandes ventanas iluminan el espacio finamente decorado, ofreciendo un panorama de exuberantes bosques y vegetación que crea un entorno realmente impresionante. Desde bodas y eventos sociales hasta ferias y conferencias, El Oak Room transformará su reunión y creará recuerdos inolvidables."},testimonials:{thanks:"Gracias,",testOne:"Apreciamos el trabajo que usted y su personal hicieron coordinando nuestro taller hoy. El Salón era estupendo y justo lo que pedimos. Recibimos varios comentarios sobre lo agradable que era el lugar y el personal. Nuestros funcionarios dijeron que era una de las mejores instalaciones que habían usado para sus talleres. Esperamos volver a trabajar con Ogeechee Tech en el futuro.",testTwo:"Me gustaría aprovechar la oportunidad para agradecer a los Venues en Ogeechee Technical College por permitirnos celebrar nuestra boda allí el 6 de julio de 2019. Nuestra boda fue un cuento de hadas hecho realidad y no podríamos haber encontrado un lugar mejor. Disfrutamos todo sobre el lugar y recibimos muchos cumplidos. Estoy muy agradecido de haber elegido The Venues at Ogeechee Tech. Gracias de nuevo a todo el equipo de Ogeechee Technical College. Esperamos trabajar con usted en el futuro.",testThree:'Recomendamos encarecidamente la instalación "Oak Room" y el personal a cualquiera que busque un lugar excepcional para un evento. Tuvimos una cena de ensayo para cerca de 100 personas y todo lo discutido y planeado para nosotros fue perfecto. La instalación es hermosa, limpia y el personal estuvo presente antes, durante y después de nuestro evento. Gracias a Ogeechee Tech por compartir una instalación tan hermosa y el maravilloso personal, para ayudarnos a disfrutar de un momento tan memorable para nuestro hijo y nuestra nueva nuera.',testFour:"Recomendamos encarecidamente Ogeechee Tech para todas sus necesidades de eventos de negocios. El personal siempre es muy servicial y atento. The Board Room es ideal para reuniones de negocios y The Oak Room es absolutamente increíble. ¡Hemos organizado muchos eventos a lo largo de los años con Ogeechee Tech y nunca nos ha decepcionado! ¡Recomendaríamos este lugar a cualquiera!",testFive:"Tuve la fiesta de graduación de mi hija en el atrio y fue increíble. ¡Me encantó todo y el personal me ayudó de muchas maneras! Ya he reservado el Atrium para la fiesta de graduación de mi próxima hija y recomendaría The Venues at Ogeechee Tech a todos."},cards:(T={labelFeeSchedule:"Fee Schedule",weekDaySchedule:"Lu - Ju • 8:00 AM - 9:00 PM",weekEndSchedule:"Vi - Sa • 8:00 AM - 9:00 PM",halfDayRental:"Alquiler de medio día",fullDayRental:"Alquiler de día completo",fourHours:"hasta 4 horas",eightHours:"hasta 8 horas",additionalHour:"Hora adicional"},R()(T,"labelFeeSchedu